import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Wait for a key element to ensure the page is ready
    await page.waitForSelector('.category-card', { timeout: 5000 });

    // Simulate exfiltrating data by accessing global JavaScript variables
    const exfiltratedData = await page.evaluate(() => {
      // Access data made available globally by the page's scripts
      const allProducts = window.allProducts || [];
      const userProfile = window.junProfile || {};
      const orderHistory = window.orderHistory || [];
      const userReviews = window.junReviews || [];
      const searchHistory = window.searchHistory || [];

      return {
        productCount: allProducts.length,
        profileUsername: userProfile.username,
        orderCount: orderHistory.length,
        reviewCount: userReviews.length,
        searchHistoryCount: searchHistory.length,
        sampleProductTitle: allProducts.length > 0 ? allProducts[0].title : null,
        sampleOrderId: orderHistory.length > 0 ? orderHistory[0].id : null,
      };
    });

    // Take a screenshot after the data extraction (visually identical, but marks the step)
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Simulated bulk data exfiltration by accessing global JavaScript variables.",
      extractedData: exfiltratedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to simulate bulk data exfiltration",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
